const stripePromise = loadStripe(STRIPE_PUBLISHABLE_KEY);

	console.log('promise is ' + STRIPE_PUBLISHABLE_KEY)
	console.log('promise is ' + (JSON.stringify(stripePromise)))
	console.log('promise is ' + stripePromise)

// options={options}
ReactDOM.render(
	<Provider store={store}>
